import React from "react";

export default function JsSideMenu() {
  return (
    <div className="jsSideMenu">
      <ul>
        <li>
          <a href="/js/loop">Loop</a>
        </li>
        <li>
          <a href="/js/condition">Condition</a>
        </li>
      </ul>
    </div>
  );
}
